import '../index.css';

import React from 'react';
let tokensArray = ['ETHUSDT','SOLUSDT','BTCUSDT','DOGEUSDT','DASHUSDT','LTCUSDT'];
export default function TokenBlock(){
    return (
        <div class ='grid grid-cols-3 w-[680px]'>
            {tokensArray.map((token, index) => (
                <div key={index} className='crypto-block'>
                    <div><img src="" alt="" /></div>
                    <div><span className='font-medium'>{token}</span></div>
                </div>
            ))}
        </div>
    );
}
